import axios from "axios";
const Base_url = "http://localhost:8080";

const GetRequests = async (path) => {

    let options = {
      url:`${Base_url+path}`,
      headers:{
        "content-type":"application/json"
      },
      method:"GET"
    }

    try{
      let {data} = await axios(options)
      return data;
    }catch(error){
        console.log("Error "+error)
    }
  }

export {GetRequests};
